import man from '../assets/Man.png'
import backGroundImg from '../assets/Group 2.png'
function OnBoarding() {
    return (
        <div className="background" style={{backgroundImage :{backGroundImg}}}>
            <div >
                < img src={man} alt="man"/>
            </div>
        </div>
    );
}

export default OnBoarding;
